iscina propia y jard&iacute;n parquizado aprox 12 metros libres. Del living pasamos a la preciosa&nbsp;cocina con isla independiente equipada, con&nbsp;despensa , para guardar las compras y una amplia zona de lavadero. Saliendo de la cocina nos encontramos con un con ba&ntilde;o completo y escritorio con vista al frente.<br /><br />Subimos a la segunda planta&nbsp;con el magn&iacute;fico ventanal en la escalera, donde nos encontramos con un amplio hall de distibuci&oacute;n tipo escrotorio con (3) tres habitaciones. 2 de ellas tienen vistas maravillosas&nbsp;al jard&iacute;n, con mucha luz natural, en la misma planta&nbsp; al contrafrente nos encontramos con una amplia terraza privada , paseando por el pasillo nos encontramos con otro ba&ntilde;o completo con ba&ntilde;era y una de las tres habitaciones cuenta con amplio vestidor y con el ba&ntilde;o completo en suite.<br /><br />&nbsp;Dos a&ntilde;os de antig&uuml;edad.<br /><br />La casa incluye siguientes&nbsp;instalaciones:<br />-Piscina climatizada&nbsp; <br />-riego por aspersi&oacute;n.<br />-aire acondicionado en todos los ambientes<br />-living y cocina; la calefacci&oacute;n a gas;<br /><br />Se toma propiedad de menor valor en Castelar/Ituzaing&oacute;.<br /><br />UNA UBICACI&Oacute;N ESTUPENDA<br /><br />Mar&iacute;a Eugenia Residences &amp; Village se ubica en el km. 34 del Acceso Oeste, localidad de Moreno, ofreciendo cercan&iacute;a con algunos de los principales colegios, shoppings, hipermercados y &aacute;reas de servicio de la zona. El barrio cuenta con p&oacute;rtico de seguridad, personal de seguridad las 24hs, vigilancia por CCTV, doble cerco e iluminaci&oacute;n LED.<br /><br />Desarrollado sobre una fracci&oacute;n de 8 hect&aacute;reas, dispone viviendas con diferentes alternativas para cada etapa de la vida:<br />- Casas<br />- Town Houses<br />- Departamentos de 1, 2, 3 y 4 ambientes<br /><br />Mar&iacute;a Eugenia R&amp;V cuenta con una amplia variedad de amenities, entre las que se encuen