 totalmente equipada, se comunica con la cochera y con una zona de alacena, tambi&eacute;n conducen al exterior con vistas y salida al parque , que da a una galeria semicubierta y a la piscina.<br />En la segunda planta encontramos cuatro espaciosas habitaciones todas con armarios empotrados con dos (2) ba&ntilde;os completos, uno de ellos en suite con vestidor separado. Tambi&eacute;n dispone de una bonita terraza privada con maravillas vistas al parque. La parte trasera de la casa tiene un quincho totalmente equipado bien conectado y funcional con el jardin. El &aacute;rea de jard&iacute;n y galeria en la planta baja, hay espacio chill out y una espectacular piscina con solarium.<br /><br />Entre sus calidades&nbsp;garaje interior para 2 coches y amplio espacio exterior para estacionar con entrada de auto tipo afrencesado , armarios empotrados, calefacci&oacute;n central frio calor, aire acondicionado, gran parque con zona ajardinada.&nbsp;Aberturas de alumunio doble vidrio. Cabe destacar las calidades utilizadas<br />en la construcci&oacute;n de la vivienda que se puede ver en materiales nobles as&iacute; como en detalles como la carpinter&iacute;a de aluminio con seguridad, persianas el&eacute;ctricas, aire acondicionado por sector, madera usada en los pisos y muebles empotrados. La casa tambi&eacute;n tienen un avanzado sistemas de vigilancia como c&aacute;maras de seguridad y sensores perimetrales tanto en el interior como en el exterior.&nbsp;<br /> Excelente ubicaci&oacute;n en unas de las zonas m&aacute;s residenciales de Castelar con f&aacute;cil acceso, y a tres cuadras de Av. Sarmiento.<br /><br />DISTRUBUCI&Oacute;N<br />Sup Total: 750m2<br />Sup Cub: 300m2<br />Habitaciones: 3<br />Ba&ntilde;os: 4','[\"0__foto_portada__2021_08_01_21_48_22__DSC_1160.jpg\"]','[\"0__galeria_fotos__2021_08_01_21_48_31__DSC_1160.jpg\",\"1__galeria_fotos__2021_08_01_21_51_27__DSC_1168.jpg\",\"2__galeria_fotos__2021_08_01_21_53_00__DSC_1171.jpg\",\"3__galeria_fotos__2021_08_0